import React from 'react';
import s from "./../Dialogs.module.css";

const Message = (props) => {

   let author = s.message;

    if(props.author == 'me'){
        author += _me;
    }else{
        author += '_other';
    }

    return (
    <div className={author}>{props.message} </div>
    );
}

export default Message;
